import logo from './logo.svg';
import React, {Suspense} from 'react';
import{Helmet} from "react-helmet";

import './App.css';
//import {OriginalUI} from './original_ui/OriginalUi.jsx';

const OriginalUI = React.lazy( () => import('./original_ui/OriginalUi.jsx') )

function App() {

  function setUpJFAPI(){
    var body = document.querySelector('body');
    var apiScriptSrc = "https://js.jotform.com/JotForm.js"; //used to retrieve API URL prior to removing from DOM
    var APIScript = ''

    //reinject the jotform URL inside a new script tag
    function injectAPIScript(){
      //debugger;
      APIScript = document.createElement('script'); //create new script
      APIScript.src = apiScriptSrc
      body.appendChild(APIScript) 
    }
    injectAPIScript();

    //initialise the script
    function initScript(APIScript){
        APIScript.initialize( {apiKey: "f78958f78beefa5e3e88255e7559579b"} ); 
    }
    setTimeout( () => { initScript(JF); },5000);



    //  try{
    //  initScript();
    //  }
    //  catch{ 'the err is' }
  }
  //setUpJFAPI();

  return (
  <>
    <h1>hello</h1>
    {<Suspense>{JF && <OriginalUI/>}</Suspense>}
    <Helmet>    <script id="jotform-api-script" src="https://js.jotform.com/JotForm.js"></script> </Helmet>
  </>
  );
}

export default App;
